A x B represents the Cartesian product of sets A and B. It is a set of all ordered pairs (a, b) where a is an element of A and b is an element of B. 

A x B = {(a, b) | a ∈ A, b ∈ B}

For A = {1, 2} and B = {3, 4}, we can find A x B as follows:

A x B = {(1, 3), (1, 4), (2, 3), (2, 4)}

Now, let's find B x A:

B x A = {(b, a) | b ∈ B, a ∈ A}

For B = {3, 4} and A = {1, 2}, we can find B x A as follows:

B x A = {(3, 1), (3, 2), (4, 1), (4, 2)}

Now, let's compare A x B and B x A:

A x B = {(1, 3), (1, 4), (2, 3), (2, 4)}
B x A = {(3, 1), (3, 2), (4, 1), (4, 2)}

As we can see, the ordered pairs in A x B and B x A are not the same. Therefore, A x B is not equal to B x A.
